import './App.css';
import Nav from './Nav';
import { useState } from 'react';

function App() {
  const [nav, setNav] = useState(false);
  const handleSetNav = (value) => {
    setNav(value);
  };
  return (
   <>
    <Nav />
    <Outlet setNav={handleSetNav}/>
    {/* <Footer /> */}
   </>
  );
}

export default App;
